#
# TABLE STRUCTURE FOR: admin
#

DROP TABLE IF EXISTS `admin`;

CREATE TABLE `admin` (
  `id_admin` bigint(255) NOT NULL AUTO_INCREMENT,
  `nama` varchar(1000) NOT NULL,
  `alamat` longtext NOT NULL,
  `email` varchar(100) DEFAULT NULL,
  `username` varchar(100) NOT NULL,
  `password` varchar(1000) NOT NULL,
  `level` int(2) NOT NULL DEFAULT 2,
  `foto` varchar(2000) NOT NULL,
  `hp` varchar(14) DEFAULT NULL,
  `kelamin` varchar(1) NOT NULL,
  `last_login` datetime NOT NULL,
  `id_jabatan` int(255) NOT NULL DEFAULT 0,
  `email_token` varchar(4000) DEFAULT NULL,
  `email_verified` int(1) NOT NULL DEFAULT 0,
  `reset_token` varchar(4000) DEFAULT NULL,
  `id_karyawan` bigint(255) DEFAULT NULL,
  `id_group` int(100) DEFAULT NULL,
  `status_adm` tinyint(1) NOT NULL DEFAULT 1,
  `skin` varchar(30) NOT NULL DEFAULT 'skin-blue',
  `status` tinyint(1) NOT NULL DEFAULT 1,
  `create_date` datetime NOT NULL,
  `update_date` datetime NOT NULL,
  `create_by` bigint(255) NOT NULL,
  `update_by` bigint(255) NOT NULL,
  PRIMARY KEY (`id_admin`) USING BTREE,
  UNIQUE KEY `username` (`username`) USING BTREE,
  KEY `idx` (`email`,`id_karyawan`,`id_group`)
) ENGINE=InnoDB AUTO_INCREMENT=117 DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;



